freq_proto = prototypes_frequency(trained_data)

def euclidean_distance(from_cluster, classify):
    distance = 0
    for attribute in range(len(from_cluster)):
        if attribute == 0:
            continue
        else:
            distance+= math.pow(from_cluster[attribute]-classify[attribute], 2)
    return math.sqrt(distance)

#context model
def context_model(categorized_data, data, similarity_fn, distance_fn=None, lower=16000, upper=20000):
    alphabet = "ABCDEFGHIJKLMNOPQRSTUVWXYZ"
    categorized = []
    initial_sum_similarity = []

    #make template for initial category and similarity
    for category in alphabet:
        categorized.append([[category]])
        initial_sum_similarity.append(0.0)

    #for each new stimuli to classify, compare it to instances in a category and accumulate their "similarity score". Repeat for every category for each instance.
    for stimuli in range(lower, upper):
        sum_similarities = copy.deepcopy(initial_sum_similarity)
        percent = copy.deepcopy(initial_sum_similarity)

        for category in range(len(categorized_data)):
            for instance in range(len(categorized_data[category])):
                sum_similarities[category] += similarity_fn(categorized_data[category][instance], data[stimuli], distance_fn)
        total_sum_similarity = 0.0

        for similarity_val in range(len(sum_similarities)):
            sum_similarities[similarity_val] /= len(categorized_data[similarity_val])
            total_sum_similarity += sum_similarities[similarity_val]

        for i in range(len(percent)):
            percent[i] = sum_similarities[i]/total_sum_similarity
        index = percent.index(max(percent))
        categorized[index].append(data[stimuli])

    return categorized


