def prototype_model(prototypes, data, similarity_fn, distance_fn=None, lower=16000, upper=20000):
    categorized = copy.deepcopy(prototypes)

    for stimuli in range(lower, upper):
        similarity = [float("-infinity"), -1]
        for prototype in range(len(prototypes)):
            cur_similarity = similarity_fn(prototypes[prototype][0], data[stimuli], distance_fn)
            if cur_similarity > similarity[0]:
                similarity[0] = cur_similarity
                similarity[1] = prototype
        categorized[similarity[1]].append(data[stimuli])
    return categorized

