#Result string
def result(data):
    categorized_data = data
    #[True Assignment, right, wrong, total]
    confusion_matrix = []
    for category in categorized_data:
        confusion_matrix.append([category[0][0], 0, 0, 0])

    for category in range(len(categorized_data)):
        for instance in range(1, len(categorized_data[category])):
            if categorized_data[category][0][0] == categorized_data[category][instance][0]:
                confusion_matrix[category][1] += 1
                confusion_matrix[category][3] += 1
            else:
                confusion_matrix[category][2] += 1
                confusion_matrix[category][3] += 1
    confusion_table = "True Assignment\tright\twrong\ttotal\n"
    confusion_table_total = confusion_table
    total_right = 0
    total_wrong = 0
    total = 0
    for category in confusion_matrix:
        total += category[3]
        total_right += category[1]
        total_wrong += category[2]
        confusion_table += category[0] +"\t" + str(category[1])  +"\t" + str(category[2]) +"\t" + str(category[3]) + "\n"
    confusion_table_total += "Total" + "\t" + str(total_right) + "\t" + str(total_wrong) + "\t" + str(total)

    return confusion_table, confusion_table_total, (total_right/1.0)/total
